import React from "react";
import "./App.css";
import Navbar from "./components/layout/Navbar";
import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles'

const theme = createMuiTheme

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <Navbar />
    </ThemeProvider>
  );
};

export default App;
